"original": |2-
     In general, equivalent "tel" URLs converted to SIP or SIPS URIs in
     this fashion may not produce equivalent SIP or SIPS URIs.  The
     userinfo of SIP and SIPS URIs are compared as a case-sensitive
     string.  Variance in case-insensitive portions of tel URLs and
     reordering of tel URL parameters does not affect tel URL equivalence,
     but does affect the equivalence of SIP URIs formed from them.
"fixed": |-
  In general, equivalent "tel" URLs converted to SIP or SIPS URIs in this fashion may not produce equivalent SIP or SIPS URIs.  The userinfo of SIP and SIPS URIs are compared as a case-sensitive string.  Variance in case-insensitive portions of tel URLs and reordering of tel URL parameters does not affect tel URL equivalence, but does affect the equivalence of SIP URIs formed from them.
"ko": |-
  일반적으로 이러한 방식으로 SIP 또는 SIPS URI로 변환된 동등한 "전화" URL은 동등한 SIP 또는 SIPS URI를 생성하지 않을 수 있습니다. SIP 및 SIPS URI의 사용자 정보는 대소문자를 구분하는 문자열로 비교됩니다. 전화 URL에서 대소문자를 구분하지 않는 부분의 차이와 전화 URL 매개변수의 순서 변경은 전화 URL 동등성에 영향을 주지 않지만, 이로부터 형성된 SIP URI의 동등성에는 영향을 미칩니다.
